#include <algorithm>
#include <iostream>
#include <vector>
int rows;
int cols;

using namespace std;

typedef std::vector<std::vector<int>> Matrix;
typedef std::vector<std::vector<std::vector<int>>> BackTrack;
typedef std::vector<std::vector<int>> BackTrackRow;
typedef std::vector<int> Row;

void fillMatrix(Matrix &M, BackTrack &B)
{

  for (size_t i = 0; i < rows; i++)
  {
    Row row(rows);

    for (size_t j = 0; j < cols; j++)
    {
      row[j] = -1;
    }

    M.push_back(row);
  }

  for (size_t i = 0; i < rows; i++)
  {
    BackTrackRow row(rows);

    for (size_t j = 0; j < cols; j++)
    {
      std::vector<int> subRow(2);

      subRow[0] = 0;
      subRow[1] = 0;

      row.push_back(subRow);
    }
    B.push_back(row);
  }
}

int checkNeighbour_aux(int posR, int posC, Matrix &mat,Matrix &memo, BackTrack &back)
{
    if (posR < 0 || posR >= cols || posC < 0 || posC >= rows)
        return 0;
 

    if (memo[posR][posC] != -1)
        return memo[posR][posC];
 
    int CP1 = -1,CL1 = -1,RL1 = -1, RP1 = -1;
 

    if (posC <rows - 1 && ((mat[posR][posC] + 1) == mat[posR][posC + 1]))
        CP1 = 1 + checkNeighbour_aux(posR, posC + 1, mat, memo,back);
 
    if (posC > 0 && (mat[posR][posC] + 1 == mat[posR][posC - 1]))
       CL1 = 1 + checkNeighbour_aux(posR, posC - 1, mat, memo,back);
 
    if (posR > 0 && (mat[posR][posC] + 1 == mat[ posR- 1][posC]))
       RL1 = 1 + checkNeighbour_aux(posR - 1, posC, mat, memo,back);
 
    if (posR <rows - 1 && (mat[posR][posC] + 1 == mat[posR + 1][posC]))
        RP1 = 1 + checkNeighbour_aux(posR + 1, posC, mat, memo,back);
 

    
    memo[posR][posC] = max({CP1,CL1,RL1, RP1, 1});
    if(memo[posR][posC] == 1)
    {
      back[posR][posC] = {0, 0};
    }
    else
    {
      if (memo[posR][posC] == RL1)
      {
        back[posR][posC] = {-1, 0};
      }
      else
      {
        if (memo[posR][posC] == RP1)
        {
          back[posR][posC] = {1, 0};
        }
        else
        {
          if (memo[posR][posC] == CL1)
          {
            back[posR][posC] = {0, -1};
          }
          else
          {
            if (memo[posR][posC] == CP1)
            {
              back[posR][posC] = {0, 1};
            }
          }
        }
      }
    }
  

 return memo[posR][posC] ;
}

void backtrack(Matrix M, BackTrack B, int posR, int posC)
{

  std::cout << M[posR][posC] << " ";
  int x = posR + B[posR][posC][0];
  int y = posC + B[posR][posC][1];
  if (!(x == posR && y == posC))
  {
    backtrack(M, B, x, y);
  }
}
 

int checkNeighbour(Matrix mat)
{
    int result = 0; 
    int posR,posC;
 
    Matrix memo;
    BackTrack back;
    fillMatrix(memo,back);

 
    for (int i = 0; i <rows; i++) {
        for (int j = 0; j <rows; j++) {
            if (memo[i][j] == -1)
                checkNeighbour_aux(i, j, mat, memo, back);
            if(result < memo[i][j]){
                result = memo[i][j];
                posR = i;
                posC = j;
            }
            
        }
    }
    
    backtrack(mat,back,posR,posC);

 
    return result;
}
 
